INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クローチェ", 2, 2002, 126401, 1, 10001, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 1, 0.0, 1.47, "2023/09/22 14:59:59", "2023/06/30 12:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クローチェ", 1, 2002, 126401, 2, 10002, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 2, 1, 0.0, 2.15, "2023/09/22 14:59:59", "2023/06/30 12:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ライラエル", 2, 2002, 126501, 2, 10003, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 1, 1, 0.0, 0.0, "2023/09/22 14:59:59", "2023/06/30 12:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ライラエル", 1, 2002, 126501, 1, 10004, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 2, 1, 0.0, 0.0, "2023/09/22 14:59:59", "2023/06/30 12:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "リンド", 2, 2002, 127702, 2, 10005, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 1, 2, 0.0, 0.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "リンド", 2, 2002, 127702, 2, 10006, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2, 0.0, 0.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴルム", 1, 2002, 127802, 1, 10007, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 2, 0.0, 0.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴルム", 1, 2002, 127802, 2, 10008, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2, 2, 0.0, 6.5, "2023/12/22 14:59:59", "2023/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "アネモネ", 1, 2002, 129602, 2, 10009, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 3, 0.0, 0.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "アネモネ", 1, 2002, 129602, 2, 10010, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 2, 3, 0.0, 0.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ネフィ=ネラ", 1, 2002, 129701, 1, 10011, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 3, 0.0, 0.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ネフィ=ネラ", 1, 2002, 129701, 2, 10012, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 2, 3, 0.0, 6.2, "2024/03/22 14:59:59", "2023/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "カノン", 5, 2002, 130301, 3, 10013, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 1, 4, 0.0, 3.1, "2024/06/22 14:59:59", "2024/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "カノン", 2, 2002, 130301, 3, 10014, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 4, 0.0, 6.15, "2024/06/22 14:59:59", "2024/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ナーナ", 2, 2002, 130401, 2, 10015, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 1, 4, 0.0, 0.0, "2024/06/22 14:59:59", "2024/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ナーナ", 1, 2002, 130401, 2, 10016, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 2, 4, 0.0, 3.35, "2024/06/22 14:59:59", "2024/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ホウオウ", 1, 2002, 130502, 1, 10017, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 5, 0.0, 0.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ホウオウ", 1, 2002, 130502, 2, 10018, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 2, 5, 0.0, 3.18, "2024/09/22 14:59:59", "2024/06/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ホウオウ", 4, 2002, 130503, 4, 10019, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 3, 5, 0.0, 0.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ネア", 2, 2002, 123301, 1, 10020, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 1, 5, 0.0, 4.9, "2024/09/22 14:59:59", "2024/06/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ネア", 2, 2002, 123301, 1, 10021, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 5, 0.0, 4.8, "2024/09/22 14:59:59", "2024/06/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "カリザ", 1, 2002, 133301, 3, 10022, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 6, 0.0, 4.922, "2024/12/22 14:59:59", "2024/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "カリザ", 5, 2002, 133301, 3, 10023, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 2, 6, 0.0, 9.638, "2024/12/22 14:59:59", "2024/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ミーア", 2, 2002, 133401, 1, 10024, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 1, 6, 0.0, 2.88, "2024/12/22 14:59:59", "2024/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ミーア", 1, 2002, 133401, 5, 10025, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 2, 6, 0.0, 4.818, "2024/12/22 14:59:59", "2024/09/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "グレイス", 1, 2002, 133002, 2, 10026, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1, 7, 0.0, 1.78, "2025/03/22 14:59:59", "2024/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "グレイス", 7, 2002, 133002, 1, 10027, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 2, 7, 0.0, 6.15, "2025/03/22 14:59:59", "2024/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴァイオレット", 2, 2002, 133102, 6, 10028, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 1, 7, 0.0, 4.28, "2025/03/22 14:59:59", "2024/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴァイオレット", 1, 2002, 133102, 1, 10029, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 2, 7, 0.0, 0.0, "2025/03/22 14:59:59", "2024/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ルルィ", 1, 2002, 136902, 2, 10030, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 1, 8, 0.0, 5.53, "2025/06/23 14:59:59", "2025/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ルルィ", 7, 2002, 136902, 9, 10031, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 2, 8, 0.0, 6.05, "2025/06/23 14:59:59", "2025/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "デュラン", 1, 2002, 137001, 2, 10032, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 1, 8, 0.0, 0.0, "2025/06/23 14:59:59", "2025/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "デュラン", 1, 2002, 137001, 2, 10033, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 2, 8, 0.0, 0.0, "2025/06/23 14:59:59", "2025/03/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "サツキ", 2, 2002, 135902, 2, 10034, "おう\n好きなもん持ってきな", 1, 9, 0.0, 0.0, "2025/09/23 14:59:59", "2025/06/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "サツキ", 6, 2002, 135902, 1, 10035, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 2, 9, 0.0, 4.935, "2025/09/23 14:59:59", "2025/06/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ユキノ", 5, 2002, 135802, 2, 10036, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 1, 9, 0.0, 7.441, "2025/09/23 14:59:59", "2025/06/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ユキノ", 7, 2002, 135802, 7, 10037, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 2, 9, 0.0, 0.0, "2025/09/23 14:59:59", "2025/06/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クルル", 2, 2002, 130901, 2, 10038, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 1, 10, 0.0, 2.295, "2025/12/22 14:59:59", "2025/09/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クルル", 6, 2002, 130901, 1, 10039, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 2, 10, 0.0, 6.281, "2025/12/22 14:59:59", "2025/09/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴォルガーノ", 1, 2002, 137701, 2, 10040, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 1, 10, 0.0, 5.549, "2025/12/22 14:59:59", "2025/09/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ヴォルガーノ", 6, 2002, 137701, 3, 10041, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 2, 10, 0.0, 2.64, "2025/12/22 14:59:59", "2025/09/16 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ライラエル", 4, 2002, 132801, 7, 10042, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 1, 11, 0.0, 7.642, "2026/03/23 11:59:59", "2025/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "ライラエル", 1, 2002, 132802, 1, 10043, "この我に店番させるとは…\n全て買わねば許さぬぞ\n我が国庫に貢献するが良い", 2, 11, 0.0, 0.0, "2026/03/23 11:59:59", "2025/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クローチェ", 1, 2002, 134502, 1, 10044, "アナライズっ！\n本日のオススメ商品は～…\nこちらですっ♪", 1, 11, 0.0, 0.0, "2026/03/23 11:59:59", "2025/12/15 15:00:00");
INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (-470.0, "クローチェ", 1, 2002, 134501, 2, 10045, "ギガンティックローチェ、\nおひとついかがですかっ？\n格納庫用意して下さいねっ", 2, 11, 0.0, 3.72, "2026/03/23 11:59:59", "2025/12/15 15:00:00");
